import React, { ChangeEvent, InputHTMLAttributes } from "react";
import css from "./index.module.css";

interface Props {
  ChangePropsHandler: (
    event: ChangeEvent<InputHTMLAttributes<HTMLInputElement>>
  ) => void;
  id: string;
  type: string;
  disabled: boolean;
  text: string;
}

const InputValue: React.FC<{
  changeHandler: Props;
}> = ({ changeHandler }) => {
  return (
    <fieldset className={css.fieldset}>
      <label htmlFor={changeHandler.id} className={css.label}>
        {changeHandler.text}
      </label>
      <input
        id={changeHandler.id}
        type={changeHandler.type}
        disabled={changeHandler.disabled}
      />
    </fieldset>
  );
};

export default InputValue;
